import { useHistory } from 'react-router-dom';

const About = () => {
  const history = useHistory();

  const goBackToHomepage = () => {
    history.push('/'); 
  };

  return (
    <div>
      <h1>Coming soon ...</h1>
      <button onClick={goBackToHomepage}>Go Back to Homepage</button>
    </div>
  );
};

export default About;
